import React from 'react';

const Navbar = () => {
  return (
    <ul>
      <li><a href="/">Home</a></li>
      <li><a href="/about">About</a></li>
      <li><a href="/contact">Contact</a></li>
    </ul>
  );
}

export default Navbar;
